import React from "react";
import { Link } from "react-router-dom"; // Import the Link component
import img1 from '../images/arijit2.jpg';
import img2 from '../images/armaan.jpg';
import img3 from '../images/akash.jpg';
import img4 from '../images/shashi.jpg';
import img5 from '../images/aujla.png';
import img6 from '../images/bassi.jpg';

const HomePage = () => {
  return (
    <div className="bg-black min-h-screen text-white">
      <div className="finished-shows">
        <div className="flex flex-wrap justify-between w-11/12 mb-">
          {/* Row 1 */}
          {[
            {
              src: img1,
              alt: "Arijit Singh Show",
              title: "Concert A - Arijit Singh Show",
              description: "Experience the soulful melodies of Arijit Singh live, as he brings his mesmerizing voice to the stage, captivating audiences with his heartfelt performances."
            },
            {
              src: img2,
              alt: "Armaan Malik",
              title: "Concert B - Armaan Malik Show",
              description: "Get ready to groove with Armaan Malik's electrifying live performance, filled with his chart-topping hits and infectious energy."
            },
            {
              src: img3,
              alt: "Akash Gupta Show",
              title: "Concert C - Akash Gupta Show",
              description: "Laugh out loud with Akash Gupta's hilarious stand-up comedy, where everyday life meets side-splitting humor and witty observations."
            },
          ].map((concert, index) => (
            <div key={index} className="w-full md:w-1/3 p-2">
              <div className="bg-slate-900 text-white rounded-lg overflow-hidden">
                <img src={concert.src} alt={concert.alt} className="w-full h-48 object-cover" />
                <div className="p-2"> {/* Reduced padding */}
                  <div className="title text-violet-400 font-serif text-xl mb-1">{concert.title}</div> {/* Reduced margin */}
                  <div className="desc font-serif text-violet-200 text-sm">{concert.description}</div> {/* Reduced margin */}
                  <div className="flex justify-center mt-2">
                    <Link to="/detailsFinsihed" className="bg-black text-violet-300 p-1 text-sm font-serif rounded-xl details-button">
                      Details
                    </Link>
                  </div>
                </div>
              </div>
            </div>
          ))}

          {/* Row 2 */}
          {[
            {
              src: img4,
              alt: "Shashi Dhiman Show",
              title: "Concert D - Shashi Dhiman Show",
              description: "Experience the wit and charm of Shashi Dhiman as he delivers punchlines that will leave you in stitches and wanting more."
            },
            {
              src: img5,
              alt: "Karan Aujla Show",
              title: "Concert E - Karan Aujla Show",
              description: "Get ready for an electrifying night with Karan Aujla, as he brings his high-energy Punjabi beats and hit tracks to the stage."
            },
            {
              src: img6,
              alt: "Anubhav Bassi Show",
              title: "Concert F - Anubhav Bassi Show",
              description: "Laugh out loud with Anubhav Bassi as he takes you on a hilarious journey through his witty anecdotes and relatable stories."
            },
          ].map((concert, index) => (
            <div key={index} className="w-full md:w-1/3 p-2">
              <div className="bg-slate-900 text-white rounded-lg overflow-hidden">
                <img src={concert.src} alt={concert.alt} className="w-full h-48 object-cover" />
                <div className="p-2"> {/* Reduced padding */}
                  <div className="title text-violet-400 font-serif text-xl mb-1">{concert.title}</div> {/* Reduced margin */}
                  <div className="desc font-serif text-violet-200 text-sm">{concert.description}</div> {/* Reduced margin */}
                  <div className="flex justify-center mt-2">
                    <Link to="/detailsFinsihed" className="bg-black text-violet-300 p-1 text-sm font-serif rounded-xl details-button">
                      Details
                    </Link>
                  </div>
                </div>
              </div>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default HomePage;
